import{_ as t,c as a,a8 as r,o}from"./chunks/framework.BDnHobkS.js";const d=JSON.parse('{"title":"PX4-Autopilot v1.14 Нотатки щодо релізу","description":"","frontmatter":{},"headers":[],"relativePath":"uk/releases/1.14.md","filePath":"uk/releases/1.14.md"}'),i={name:"uk/releases/1.14.md"};function l(n,e,s,u,h,p){return o(),a("div",null,e[0]||(e[0]=[r('<h1 id="px4-autopilot-v1-14-нотатки-щодо-релізу" tabindex="-1">PX4-Autopilot v1.14 Нотатки щодо релізу <a class="header-anchor" href="#px4-autopilot-v1-14-нотатки-щодо-релізу" aria-label="Permalink to &quot;PX4-Autopilot v1.14 Нотатки щодо релізу&quot;">​</a></h1><h2 id="прочитаите-перед-оновленням" tabindex="-1">Прочитайте перед оновленням <a class="header-anchor" href="#прочитаите-перед-оновленням" aria-label="Permalink to &quot;Прочитайте перед оновленням&quot;">​</a></h2><p>The v1.14 release includes a few breaking changes for users upgrading from previous versions, in particular we are moving away from using mixer files to define the vehicle geometry, motor mappings and actuators.</p><p>Additionally, we deprecated the Fast-RTPS interface used by ROS 2 in favor of a much cleaner solution that doesn&#39;t require a custom build target, and goes away with the additional message generation step.</p><p>Please continue reading for <a href="#upgrade-guide">upgrade instructions</a>.</p><h2 id="основні-зміни" tabindex="-1">Основні зміни <a class="header-anchor" href="#основні-зміни" aria-label="Permalink to &quot;Основні зміни&quot;">​</a></h2><ul><li>Динамічне розподілення керування</li><li>Покращена звітність про перевірку помилок передпольотної підготовки</li><li>Спрощення та симуляція аварійного режиму</li><li>Стандартна симуляція тепер - Новий Gazebo</li><li>Покращений інтерфейс ROS 2 завдяки uXRCE-DDS</li></ul><h3 id="динамічне-розподілення-керування" tabindex="-1">Динамічне розподілення керування <a class="header-anchor" href="#динамічне-розподілення-керування" aria-label="Permalink to &quot;Динамічне розподілення керування&quot;">​</a></h3><p>We are very excited to enable the new <a href="./../concept/control_allocation.html">dynamic control allocation</a> by default; it allows users to define vehicle configurations at runtime without needing a mixer file, thanks to the new <a href="./../config/actuators.html">vehicle setup dashboard</a> in QGroundControl.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The new actuator configuration UI is available on QGroundControl 4.2.0 or newer.</p></div><h3 id="improved-preflight-failure-check-reporting-qgc-arming-check-report" tabindex="-1">Improved Preflight Failure Check Reporting (QGC Arming Check Report) <a class="header-anchor" href="#improved-preflight-failure-check-reporting-qgc-arming-check-report" aria-label="Permalink to &quot;Improved Preflight Failure Check Reporting (QGC Arming Check Report)&quot;">​</a></h3><p>PX4 v1.14 adds much improved preflight failure <em>reporting</em> through the <a href="./../concept/events_interface.html">events interface</a>. If the vehicle won&#39;t arm, you can more easily find out why in the <a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/fly_view/fly_view.html#arm" target="_blank" rel="noreferrer">QGC Arming Check Report</a>. No more wondering if it&#39;s a problem with the safety switch, a poor calibration, or something in the internals of the estimator!</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The QGC Arming Check Report UI is available in the <strong>QGC Daily Build</strong> (QGC v4.2.0 and later)</p></div><p>As part of this change, it is now possible to switch to any mode when disarmed (previously you could not switch to a mode that required GPS if you didn&#39;t have a good position estimate). PX4 will only allow you to arm when the conditions for the current mode are met, and will report failure checks that are not relevant to the current mode as warnings.</p><p>For more information see: <a href="./../flying/pre_flight_checks.html">QGroundControl Flight-Readiness Status</a>.</p><h3 id="спрощення-аваріиного-режиму" tabindex="-1">Спрощення аварійного режиму <a class="header-anchor" href="#спрощення-аваріиного-режиму" aria-label="Permalink to &quot;Спрощення аварійного режиму&quot;">​</a></h3><p><a href="./../config/safety.html">Safety Failsafe</a> handling has been simplified, in particular with respect to what happens if a failsafe is triggered when another failsafe is already in progress.</p><ul><li>Тепер перед виконанням дії є затримка утримання, що дає користувачеві час для скасування аварійного режиму, якщо це необхідно.</li><li>If multiple failsafes are triggered, the more severe <em>action</em> is taken. Наприклад, якщо втрачені як радіо контроль, так і GPS, і втрата керування вручну встановлена в режим Повернутися, а втрата зв&#39;язку з GCS встановлена в режим Посадка, виконується Посадка.</li></ul><p>The new <a href="./../config/safety_simulation.html">Failsafe State Machine Simulation</a> allows you to test failsafe behaviour under all possible configurations and conditions.</p><h3 id="новии-gazebo" tabindex="-1">Новий Gazebo <a class="header-anchor" href="#новии-gazebo" aria-label="Permalink to &quot;Новий Gazebo&quot;">​</a></h3><p>Given <a href="https://discourse.ros.org/t/a-new-era-for-gazebo-cross-post/25012" target="_blank" rel="noreferrer">the recent changes</a> by the Open Robotics simulation team, we are introducing name changes for our gazebo simulations, mirroring Open Robotics naming scheme, starting with v1.14:</p><ul><li><a href="https://docs.px4.io/v1.13/en/simulation/ignition_gazebo.html" target="_blank" rel="noreferrer">Ignition Gazebo</a> to <a href="./../sim_gazebo_gz/">Gazebo</a></li><li><a href="https://docs.px4.io/v1.13/en/simulation/gazebo.html" target="_blank" rel="noreferrer">Gazebo</a> to <a href="./../sim_gazebo_classic/">Gazebo Classic</a>.</li></ul><p>Most importantly this affects the PX4 build target names as well:</p><ul><li>Gazebo targets are prefixed with <code>gz_</code> (e.g. <code>make px4_sitl gz_x500</code>).</li><li>Gazebo Classic <code>make</code> targets are now prefixed with <code>gazebo-classic_</code> (e.g., <code>make px4_sitl gazebo-classic_cloudship</code>).</li></ul><h3 id="покращении-інтерфеис-ros-2-за-допомогою-uxrce-dds" tabindex="-1">Покращений інтерфейс ROS 2 за допомогою uXRCE-DDS <a class="header-anchor" href="#покращении-інтерфеис-ros-2-за-допомогою-uxrce-dds" aria-label="Permalink to &quot;Покращений інтерфейс ROS 2 за допомогою uXRCE-DDS&quot;">​</a></h3><p>We updated the ROS 2 interface, replacing <a href="https://docs.px4.io/v1.13/en/middleware/micrortps.html" target="_blank" rel="noreferrer">Fast-RTPS</a> with <a href="./../ros2/user_guide.html">uXRCE-DDS</a>, resulting in an improved experience across the board. The change also avoids the need for <code>_rtps</code> build targets, enabling the interface on even more targets by default.</p><h2 id="інструкціі-для-оновлення" tabindex="-1">Інструкції для оновлення <a class="header-anchor" href="#інструкціі-для-оновлення" aria-label="Permalink to &quot;Інструкції для оновлення&quot;">​</a></h2><p>For users upgrading from previous versions, please take a moment to review the following:</p><ol><li><p>Для змін актуатора необхідно перевірити геометрію автомобіля та зв&#39;язки моторів/сервоприводів з вашим автомобілем. In QGC, find the <a href="./../config/actuators.html">Actuator Configuration Dashboard</a>, and make sure to confirm the airframe geometry matches actuals from your vehicle, as well as update motor and ensure motors and servos are mapped to outputs as they are wired to the frame and with the correct ESC type specified. Примітка: скористайтеся повзунками в користувацькому інтерфейсі. Вони можуть бути використані для підтвердження з&#39;єднання моторів.</p><p>We highly recommend running an <a href="./../advanced_config/esc_calibration.html">ESC Calibration</a> if using PWM ESC motors and then setting appropriate disarmed minimum and maximum values for the motors (in the actuator UI).</p><p>Калібрування є критичним, якщо ви використовуєте власний файл змішувача або повітряну конструкцію, яку ви призначили в попередній версії, немає в PX4 v1.14.</p><p>However, an ESC Calibration is still recommended <strong>even if</strong> you are using an airframe that precisely matches a specific vehicle in the <a href="./../airframes/airframe_reference.html">Airframe Reference</a> (such as the <a href="./../airframes/airframe_reference.html#copter_quadrotor_x_holybro_x500_v2">Holybro X500 V2</a>) as your wiring and ESCs calibration may not match the defaults.</p></li><li><p>Змінено значення вимкненого PWM за замовчуванням з 900 мкс на 1000 мкс. Перевірте, чи ви раніше використовували значення роззброєння PWM за замовчуванням і якщо зміни впливають на вашу настройку. For details, you can find related information in the <a href="./../advanced_config/esc_calibration.html#steps">step 7 of ESC calibration</a> document.</p></li><li><p>Користувачам Fast-RTPS потрібно перенести свій код на новий інтерфейс uXRCE-DDS. Код програми повинен вимагати лише незначних модифікацій. Це включає (мінімально):</p></li></ol><p>Modifying topic names to match the new naming pattern, which changed from <code>fmu/&lt;topic_name&gt;/out</code> to <code>fmu/out/&lt;topic_name&gt;</code>, and <a href="./../ros2/user_guide.html#ros-2-subscriber-qos-settings">Adusting the QoS settings</a>.</p><p>For more information see <a href="./../middleware/uxrce_dds.html#fast-rtps-to-uxrce-dds-migration-guidelines">Fast-RTPS to uXRCE-DDS Migration Guidelines</a></p><h2 id="інші-зміни" tabindex="-1">Інші зміни <a class="header-anchor" href="#інші-зміни" aria-label="Permalink to &quot;Інші зміни&quot;">​</a></h2><h3 id="підтримка-обладнання" tabindex="-1">Підтримка обладнання <a class="header-anchor" href="#підтримка-обладнання" aria-label="Permalink to &quot;Підтримка обладнання&quot;">​</a></h3><ul><li>Cubepilot Cube Orange+ - <a href="https://github.com/PX4/PX4-Autopilot/pull/20304" target="_blank" rel="noreferrer">PX4-Autopilot#20304</a></li><li>Unicore GPS: Support for Holybro Unicore UM982 GPS - <a href="https://github.com/PX4/PX4-Autopilot/pull/21214" target="_blank" rel="noreferrer">PX4-Autopilot#21214</a>)</li><li>VOXL2 Improved support - <a href="https://github.com/PX4/PX4-Autopilot/pull/21426" target="_blank" rel="noreferrer">PX4-Autopilot#21426</a></li><li>Cubepilot Cube Black detection: Fixed Cube Black vs. Pixhawk 2 detection with CAN1 connected - <a href="https://github.com/PX4/PX4-Autopilot/pull/21342" target="_blank" rel="noreferrer">PX4-Autopilot#21342</a></li></ul><h3 id="загальні" tabindex="-1">Загальні <a class="header-anchor" href="#загальні" aria-label="Permalink to &quot;Загальні&quot;">​</a></h3><ul><li>Failsafe state machine rewrite and <a href="./../config/safety_simulation.html">web simulation</a></li><li>Improved preflight failure check reporting (requires QGC <a href="https://github.com/mavlink/qgroundcontrol/releases/tag/v4.2.0" target="_blank" rel="noreferrer">v4.2.0</a> or later): <a href="https://github.com/PX4/PX4-Autopilot/pull/20030" target="_blank" rel="noreferrer">PX4-Autopilot#20030</a> and <a href="https://github.com/mavlink/qgroundcontrol/pull/10362" target="_blank" rel="noreferrer">qgroundcontrol#10362</a></li><li><a href="./../advanced/package_delivery.html">Package delivery in mission</a>: For package delivery applications, inital support for payload delivery in mission for gripper actuator was added</li><li>Manual control setpoint message redefinition: <code>manual_control_setpoint.x</code>, <code>y</code>, <code>z</code>, <code>w</code> -&gt; <code>roll</code>, <code>pitch</code>, <code>yaw</code>, <code>throttle</code>; <code>throttle scale [0,1] -&gt; [-1,1]</code> - <a href="https://github.com/PX4/PX4-Autopilot/pull/15949" target="_blank" rel="noreferrer">PX4-Autopilot#15949</a></li><li>Default motor PWM configuration - <a href="https://github.com/PX4/PX4-Autopilot/pull/21800" target="_blank" rel="noreferrer">PX4-Autopilot#21800</a></li><li>Fix PWM/Oneshot calibration - <a href="https://github.com/PX4/PX4-Autopilot/pull/21726" target="_blank" rel="noreferrer">PX4-Autopilot#21726</a></li></ul><h3 id="управління" tabindex="-1">Управління <a class="header-anchor" href="#управління" aria-label="Permalink to &quot;Управління&quot;">​</a></h3><ul><li>Land and take off again in mission: Landing doesn&#39;t disarm if the mission is not done - <a href="https://github.com/PX4/PX4-Autopilot/pull/19659" target="_blank" rel="noreferrer">PX4-Autopilot#19659</a></li><li>Окреме повідомлення цілі окреме тепер від повідомлення місцевого положення транспортного засобу. - <a href="https://github.com/PX4/PX4-Autopilot/pull/19622" target="_blank" rel="noreferrer">PX4-Autopilot#19622</a></li><li>Bugfix: &quot;Invalid setpoint&quot; message on takeoff or mode switch: The message popped up as false positive depending on timing - <a href="https://github.com/PX4/PX4-Autopilot/pull/20581" target="_blank" rel="noreferrer">PX4-Autopilot#20581</a></li><li>Bugfix: Step switching Altitude to Position: Switching from Altitude to Position with speed produced a jerk step - <a href="https://github.com/PX4/PX4-Autopilot/pull/20905" target="_blank" rel="noreferrer">PX4-Autopilot#20905</a></li></ul><h3 id="оцінки" tabindex="-1">Оцінки <a class="header-anchor" href="#оцінки" aria-label="Permalink to &quot;Оцінки&quot;">​</a></h3><ul><li><a href="./../advanced_config/tuning_the_ecl_ekf.html#height">Multiple height source fusion</a></li><li>EKF2 start without magnetometer and barometer data: Until now, a mag and a baro was mandatory to run EKF2 - <a href="https://github.com/PX4/PX4-Autopilot/pull/20021" target="_blank" rel="noreferrer">PX4-Autopilot#20021</a></li><li>Multirotor wind estimate improvements: More accurate bluff body drag model - <a href="https://github.com/PX4/PX4-Autopilot/pull/20848" target="_blank" rel="noreferrer">PX4-Autopilot#20848</a></li></ul><h3 id="датчики" tabindex="-1">Датчики <a class="header-anchor" href="#датчики" aria-label="Permalink to &quot;Датчики&quot;">​</a></h3><ul><li><a href="./../dronecan/#dronecan-subscriptions-publications">DroneCAN sensors now need to be individually enabled via <code>UAVCAN_SUB_*</code> parameters</a> - <a href="https://github.com/PX4/PX4-Autopilot/pull/18471" target="_blank" rel="noreferrer">PX4-Autopilot#18471</a></li><li>Battery estimation defaults, reporting improvements: Defaults: current based load compensation, higher empty cell voltage, shorter action delay - <a href="https://github.com/PX4/PX4-Autopilot/pull/19429" target="_blank" rel="noreferrer">PX4-Autopilot#19429</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19700" target="_blank" rel="noreferrer">PX4-Autopilot#19700</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19594" target="_blank" rel="noreferrer">PX4-Autopilot#19594</a>, <a href="https://github.com/PX4/PX4-Autopilot/pull/19679" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-Autopilot/pull/19679</a></li><li>SF45 rotation Lidar serial driver - <a href="https://github.com/PX4/PX4-Autopilot/pull/19891" target="_blank" rel="noreferrer">PX4-Autopilot#19891</a></li></ul><h3 id="симуляція" tabindex="-1">Симуляція <a class="header-anchor" href="#симуляція" aria-label="Permalink to &quot;Симуляція&quot;">​</a></h3><ul><li>[Gazebo] Запалювання Паливо для PX4: Тепер у PX4 є сховище для моделей gazebo в ignition fuel - <a href="https://app.gazebosim.org/PX4" target="_blank" rel="noreferrer">https://app.gazebosim.org/PX4</a></li><li>[Gazebo] Підтримка саду Gazebo з підтримкою місцевого транспорту запалювання: Додана підтримка місцевого транспорту запалювання для прямого взаємодії з Gazebo та симуляцією. Supported vehicles in Gazebo are X500 (Multicopter), Plane, Standard VTOL - <a href="https://github.com/PX4/PX4-Autopilot/pull/20319" target="_blank" rel="noreferrer">PX4-Autopilot#20319</a></li><li>[Gazebo-classic] Serializer for Gazebo sniffer: Added a sniffer for serializing gazebo related information - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/937" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#937</a></li><li>[Gazebo-classic] Motor failure plugin as a ros2 plugin: Motor failure plugin has been updated to be a ros2 plugin - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/862" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#862</a></li><li>[Gazebo-classic] Додавання моделі Омнікоптера: До Gazebo SITL була додана повністю актована модель омнідирекціонального транспортного засобу - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/866" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-SITL_gazebo-classic/pull/866</a></li><li>[Gazebo-classic] Addition of Advanced liftdrag plugin: Advanced liftdrag plugin that models nonlinear aerodynamics based on AVL - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/901" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#901</a></li><li>[Gazebo-classic] Addition of Safe landing world: Addition of safe landing world, for testing safe landing - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/93" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#93</a></li><li>[Gazebo-classic] Depricated Ubuntu Bionic reated tests: Removed testing due to EOL of Ubuntu Bionic - <a href="https://github.com/PX4/PX4-SITL_gazebo-classic/pull/974" target="_blank" rel="noreferrer">PX4-SITL_gazebo-classic#974</a></li><li>[SIH] Самостійні симуляції датчиків у дереві: Здатність симулювати датчики у дереві, яке було частиною SIH, тепер є самостійним модулем датчика. Sensors include magnetometer, GPS, Barometer, Airspeed - <a href="https://github.com/PX4/PX4-Autopilot/pull/20137" target="_blank" rel="noreferrer">PX4-Autopilot#20137</a>, <a href="https://github.com/PX4/PX4-Autopilot/tree/main/src/modules/simulation/sensor_airspeed_sim" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-Autopilot/tree/main/src/modules/simulation/sensor_airspeed_sim</a></li><li>[SIH] Впровадження відмов для імітації акумулятора - <a href="https://github.com/PX4/PX4-Autopilot/commit/ebc1d7544e8146788c9e7cf5e8b64f60199240e4" target="_blank" rel="noreferrer">https://github.com/PX4/PX4-Autopilot/commit/ebc1d7544e8146788c9e7cf5e8b64f60199240e4</a></li></ul><h3 id="mavlink" tabindex="-1">MAVLink <a class="header-anchor" href="#mavlink" aria-label="Permalink to &quot;MAVLink&quot;">​</a></h3><ul><li>MAVLink forwarding over USB: Forward MAVLink traffic to/from USB by default - <a href="https://github.com/PX4/PX4-Autopilot/pull/20745" target="_blank" rel="noreferrer">PX4-Autopilot#20745</a></li></ul><h3 id="мульти-ротор" tabindex="-1">Мульти-Ротор <a class="header-anchor" href="#мульти-ротор" aria-label="Permalink to &quot;Мульти-Ротор&quot;">​</a></h3><ul><li>Improved Follow-Me flight mode: Follow-me mode was improved for better user experience - <a href="https://github.com/PX4/PX4-Autopilot/pull/18026" target="_blank" rel="noreferrer">PX4-Autopilot#18026</a> | <a href="https://www.youtube.com/watch?v=rYYso87cmxA" target="_blank" rel="noreferrer">PX4 Dev Summit presentation</a></li><li>Improved Helicopter Support: <a href="./../config_heli/">Helicopter Configuration</a></li><li>Direction-based speed constraints for multirotors: Can define a different forward, backward and lateral speed - <a href="https://github.com/PX4/PX4-Autopilot/pull/19257" target="_blank" rel="noreferrer">PX4-Autopilot#19257</a></li><li>Allow yawing in hold mode: Let the pilot yaw the drone while staying in hold mode - <a href="https://github.com/PX4/PX4-Autopilot/pull/21399" target="_blank" rel="noreferrer">PX4-Autopilot#21399</a></li></ul><h3 id="vtol" tabindex="-1">VTOL <a class="header-anchor" href="#vtol" aria-label="Permalink to &quot;VTOL&quot;">​</a></h3><ul><li>Quad-chute: дозволяє скинути стан відмови. Reset failure state once operator trigger transition to FW again - <a href="https://github.com/PX4/PX4-Autopilot/pull/20913" target="_blank" rel="noreferrer">PX4-Autopilot#20913</a></li><li>Simplify Tailsitter transitions to FW in Stabilized: Adapt the tilt threshold automatically on configured max tilt setting - <a href="https://github.com/PX4/PX4-Autopilot/pull/21582" target="_blank" rel="noreferrer">PX4-Autopilot#21582</a></li><li>Refactor uncommanded descend Quad-Chute: Enables to set altitude error threshold to trigger a Quad-chute - <a href="https://github.com/PX4/PX4-Autopilot/pull/21598" target="_blank" rel="noreferrer">PX4-Autopilot#21598</a></li><li>Enable control-surface-less Quad-tailsitters: Enables to use differential thrust to control full body attitude in FW mode on tailsitters - <a href="https://github.com/PX4/PX4-Autopilot/pull/20511" target="_blank" rel="noreferrer">PX4-Autopilot#20511</a></li><li>Skip VTOL_Takeoff mission item if already in-air - <a href="https://github.com/PX4/PX4-Autopilot/pull/19985" target="_blank" rel="noreferrer">PX4-Autopilot#19985</a></li></ul><h3 id="літак-з-фіксованим-крилом" tabindex="-1">Літак з фіксованим крилом <a class="header-anchor" href="#літак-з-фіксованим-крилом" aria-label="Permalink to &quot;Літак з фіксованим крилом&quot;">​</a></h3><ul><li>Flaps/Spoiler refactor - <a href="https://github.com/PX4/PX4-Autopilot/pull/19329" target="_blank" rel="noreferrer">PX4-Autopilot#19329</a></li><li>FW Position control: switch from L1 to NPFG guidance - <a href="https://github.com/PX4/PX4-Autopilot/pull/19603" target="_blank" rel="noreferrer">PX4-Autopilot#19603</a> | <a href="https://www.youtube.com/watch?v=LY6hYBCdy-0" target="_blank" rel="noreferrer">PX4 Dev Summit presentation video</a></li><li>Automatically apply learned airspeed scale in-air - <a href="https://github.com/PX4/PX4-Autopilot/pull/19787" target="_blank" rel="noreferrer">PX4-Autopilot#19787</a></li><li>Takeoff refactor/enhancements - <a href="https://github.com/PX4/PX4-Autopilot/pull/19869" target="_blank" rel="noreferrer">PX4-Autopilot#19869</a></li><li>FW landing refactor/enhancements - <a href="https://github.com/PX4/PX4-Autopilot/pull/19871" target="_blank" rel="noreferrer">PX4-Autopilot#19871</a></li><li>Scale minimum airspeed with wind strength FW Position control: add option to scale min airspeed with wind magnitude - <a href="https://github.com/PX4/PX4-Autopilot/pull/20259" target="_blank" rel="noreferrer">PX4-Autopilot#20259</a></li><li>Improve FW hand-launch takeoff - <a href="https://github.com/PX4/PX4-Autopilot/pull/20557" target="_blank" rel="noreferrer">PX4-Autopilot#20557</a></li><li>Improve accelerated stall protection - <a href="https://github.com/PX4/PX4-Autopilot/pull/20636" target="_blank" rel="noreferrer">PX4-Autopilot#20636</a></li><li>Add option to disable manual yaw inputs - <a href="https://github.com/PX4/PX4-Autopilot/pull/20647" target="_blank" rel="noreferrer">PX4-Autopilot#20647</a></li><li>Disable airspeed rate input into TECS airspeed rate estimation has shown to be unreliable, so we decided to disable it for now - <a href="https://github.com/PX4/PX4-Autopilot/pull/21317" target="_blank" rel="noreferrer">PX4-Autopilot#21317</a></li><li>Support flying at different airspeeds Add airspeed to trim throttle mapping in TECS to support flying at different airspeeds - <a href="https://github.com/PX4/PX4-Autopilot/pull/21345" target="_blank" rel="noreferrer">PX4-Autopilot#21345</a></li><li>FWPositionControl: navigateWaypoints: fix logic if already past waypoint - <a href="https://github.com/PX4/PX4-Autopilot/pull/21642" target="_blank" rel="noreferrer">PX4-Autopilot#21642</a></li></ul>',52)]))}const f=t(i,[["render",l]]);export{d as __pageData,f as default};
